import React, { useState, useEffect } from 'react';
import axios from "axios";

import { ListResults } from "./Components/ListResults"

export const App = () => {
  const [results, setResults] = useState(null);
  const getData = async () => {
    const reply = await axios({
      method: 'get',
      url: 'http://127.0.0.1:5000/api',
      params: {
        query: 'computer',
        jump: 0
      }
    });
    console.log({ reply })
    setResults(reply)
  }
  useEffect(() => {
    getData();
  }, [])

  return (
    <div>
      <ListResults />
      <button>next</button>
    </div>
  );
}
